def bcdToDecimal(s):
	length = len(s)
	check = 0
	check0 = 0
	num = 0
	sum = 0
	mul = 1
	rev = 0
	for i in range(length - 1, -1, -1):
        sum += (ord(s[i]) - ord('0')) * mul
        mul *= 2
        check += 1
        if (check == 4 or i == 0):
            if (sum == 0 and check0 == 0):
                num = 1
                check0 = 1
            else:
                num = num * 10 + sum
            check = 0
            sum = 0
            mul = 1
	while (num > 0):
        rev = rev * 10 + (num % 10)
        num //= 10
	if (check0 == 1):
        return rev - 1
	return rev




