def unique_everseen(iterable, key=None):
	from itertools import filterfalse


	seen = set()
	seen_add = seen.add
	if key is None:
        for element in filterfalse(seen.__contains__, iterable):
            seen_add(element)
            yield element
	else:
        for element in iterable:
            k = key(element)
            if k not in seen:
                seen_add(k)
                yield element

