	if(x == 0 and y == 0):
        return 0
	z = 0
	for i in reversed(range(10)):
        z = x % 10 + y % 10 + z
        if z > 9:
            z = 1
        else:
            z = 0
        ctr += z
        x //= 10
        y //= 10
	if ctr == 0:
        return "No carry operation."
