def binary_search(l, num_find):

	start = 0
	end = len(l) - 1
	mid = (start + end) // 2
	found = False
	position = -1
	while start <= end:
        if l[mid] == num_find:
            found = True
            position = mid
            break
        if num_find > l[mid]:
            start = mid + 1
            mid = (start + end) // 2
        else:
            end = mid - 1
            mid = (start + end) // 2
	return (found, position)

