def roundrobin(*iterables):
	from itertools import islice, cycle

	num_active = len(iterables)
	nexts = cycle(iter(it).__next__ for it in iterables)
	while num_active:
        try:
            for next in nexts:
                yield next()
        except StopIteration:

            num_active -= 1
            nexts = cycle(islice(nexts, num_active))

