def compound_interest(p, r, t):
	ci = p * (pow((1 + r / 100), t))
	return ci

import math


def nearest_square(n):
	upp = math.floor(math.sqrt(n))
	low = math.floor(math.sqrt(n))
	upp_diff = upp ** 2 - n
	low_diff = n - low ** 2

	if upp_diff > low_diff:
        return upp
	else:
        return low

def mergeList(list1, list2):
	thirdList = []
	for num in list1:
        if (num % 2 != 0):
            thirdList.append(num)
	for num in list2:
        if (num % 2 == 0):
            thirdList.append(num)
	return thirdList

